"vs/workbench/services/themes/common/fileIconThemeSchema":["Kinyitott mappánál használt ikon. A kinyitott mappa ikonját nem kötelező megadni. Ha nincs  megadva, akkor a mappaikon lesz megjelenítve.","A bezárt mappák ikonja, illetve ha a folderExpanded nincs megadva, akkor a kinyitott mappáké is.","Az alapértelmezett fájlikon, ami minden olyan fájlnál megjelenik, ami nem illeszkedik egyetlen kiterjesztésre, fájlnévre vagy nyelvazonosítóra sem.","Ikonokat társít mappanevekhez. Az objektum kulcsa a mappa neve elérési útvonalrészletek nélkül. Nem tartalmazhat mintákat és helyettesítő karaktereket. A mappa nevének vizsgálatánál a kis- és nagybetűk nincsenek megkülönböztetve.","A társításhoz tartozó ikondefiníció azonosítója.","Ikonokat társít mappanevekhez kinyitott mappák esetén. Az objektum kulcsa a mappa neve elérési útvonalrészletek nélkül. Nem tartalmazhat mintákat és helyettesítő karaktereket. A mappa nevének vizsgálatánál a kis- és nagybetűk nincsenek megkülönböztetve.","A társításhoz tartozó ikondefiníció azonosítója. ","Ikonokat társít fájlkiterjesztésekhez. Az objektum kulcsa a fájlkiterjesztés neve. A kiterjesztés neve a fájl nevének utolsó része az utolsó pont után (a pont nélkül). A kiterjesztések vizsgálatánál a kis- és nagybetűk nincsenek megkülönböztetve. ","A társításhoz tartozó ikondefiníció azonosítója. ","Ikonokat társít fájlnevekhez. Az objektum kulcsa a fájl teljes neve, az elérési út többi része nélkül. A fájlnév tartalmazhat pontokat és fájlkiterjesztést. Nem tartalmazhat mintákat és helyettesítő karaktereket. A fájlnevek vizsgálatánál a kis- és nagybetűk nincsenek megkülönböztetve.","A társításhoz tartozó ikondefiníció azonosítója. ","Ikonokat társít nyelvekhez. Az objektum kulcsa a nyelvet szolgáltató komponens által definiált nyelvazonosító.","A társításhoz tartozó ikondefiníció azonosítója. ","Az ikondefiníciókban használt betűkészletek.","A betűkészlet azonosítója.","A betűkészlet elérési útjai.","A betűkészlet elérési útja, relatívan az aktuális ikontémafájlhoz képest.","A betűkészlet formátuma.","A betűkészlet betűvastagsága.","A betűkészlet stílusa.","A betűkészlet alapértelmezett mérete.","A fájlok ikonokhoz történő rendelésénél használható ikonok leírása.","Egy ikondefiníció. Az objektum kulcsa a definíció azonosítója.","SVG vagy PNG használata esetén a kép elérési útja. Az elérési út relatív az ikonkészletfájlhoz képest.","Betűkészlet használata esetén a betűkészletből használandó karakter.","Betűkészlet használata esetén a használt szín.","Betűkészlet használata esetén a betűkészlet mérete a szöveg betűkészletének méretéhez képest, százalékban. Ha nincs megadva, akkor a betűkészlet-definícióban megadott érték van használva.","Betűkészlet használata esetén a betűkészlet azonosítója. Ha nincs megadva, akkor az első betűkészlet-definíció van használva.","Fájlikon-társítások világos témák használata esetén. Nem kötelező megadni.","Fájlikon-társítások nagy kontrasztú témák használata esetén. Nem kötelező megadni.","Meghatározza, hogy a fájlkezelőben megjelenő nyilak el legyenek-e rejtve, amikor ez a téma aktív."],
